a393a4ac-fb65-4c86-9342-13fa4acad608	mE4W5FODqT	What is Outline	Outline is a place to build your team knowledge base, you could think of it like your team’s shared library – a place for important documentation, notes, and ideas to live and be discovered. Some things you might want to keep in Outline include:\n\n\\\n\n- Documentation\n- Support knowledge base\n- Product plans and RFCs\n- Sales playbooks\n- Onboarding checklists\n- Company policies\n- Meeting notes\n\n## Structure\n\nOutline allows you to organize documents in "collections", for example these could represent topics like Sales, Product, or HR. You can assign users or groups access to collections. Within collections documents can be interlinked and deeply nested to easily build relationships within your knowledge base.\n\n## Search\n\nOutline is built from the ground up to be really fast, and that includes [search](/search). You can start searching from anywhere with the `CMD+K` shortcut – then filter by time, author, and more to find the information you need. Or you can search from within Slack with the `/outline` slash command.\n	2025-10-20 12:13:57.786+00	2025-10-20 12:13:57.786+00	1032ea41-fd97-44a7-8ac0-9cbb75243e2c	536ea67a-0c1a-4692-bf77-e3d0be7e5faa	\N	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	2	'/outline':160 '/search':126 'access':90 'allow':66 'anywher':132 'assign':86 'author':142 'base':13,51,109 'build':9,104 'built':113 'checklist':59 'cmd':135 'collect':72,92,94 'command':162 'compani':60 'could':15,76 'deepli':100 'discov':37 'document':29,48,70,95 'easili':103 'exampl':74 'fast':121 'filter':139 'find':146 'ground':116 'group':89 'hr':83 'idea':32 'import':28 'includ':47,124 'inform':148 'interlink':98 'k':136 'keep':44 'knowledg':12,50,108 'librari':24 'like':19,79 'live':34 'meet':62 'might':41 'need':150 'nest':101 'note':30,63 'onboard':58 'organ':69 'outlin':3A,4,46,65,111 'place':7,26 'plan':53 'playbook':57 'polici':61 'product':52,81 'realli':120 'relationship':105 'repres':77 'rfcs