92fbc92d-3dbe-405a-a55e-f963e06bce4f	fjwA5P6yGV	Setup	This guide is based on: <https://docs.getoutline.com/s/hosting>\n\n**Requirements**\n\nThere are a few minimum services and dependencies that are required for for the Outline software to function correctly.\n\n## **Operating System**\n\nOutline should run on any Unix operating system that supports the software dependencies listed below. The docker image is based on Alpine Linux and operators have successfully deployed Outline on Ubuntu, Debian, and similar.\n\nOutline is developed Unix-compatible operating systems only. It does **not** run on Microsoft Windows server, for instance.\n\n## **Supporting Software**\n\n* **[PostgreSQL](https://www.postgresql.org/)** (v12+)\n* **[Redis](https://redis.io/)** (v4+)\n\n## **Hardware**\n\n### **CPU**\n\nOutline will run on relatively low powered hardware. CPU requirements are dependent on the number of users and expected workload. Your workload is influenced by factors such as - but not limited to - how many users are online, how active your users are, whether they are viewing and typing in documents.\n\n### **Memory**\n\nA minimum of 512MB of memory is required, depending on the number of users 1GB or more is recommended.\n\n## **Other Dependencies**\n\n* A dedicated domain or sub-domain to host Outline on (e.g. docs.yourcompany.com)\n* A compatible **[Authentication Provider](https://docs.getoutline.com/s/hosting/doc/authentication-7ViKRmRY5o)**\n\n### Pre-requisites\n\n* Docker for spinning **Outline** container\n* **NGROK** for free **HTTPS** domain\n* **Slack / Google / Azure** for **SSO**\n\n## Steps:\n\n- [ ] Download Docker\n  - [ ] Create **docker-compose.yml**\n  - [ ] Copy the outline template for **docker-compose.yml**. Update accordingly\n\n```docker\nservices:\n  outline:\n    image: docker.getoutline.com/outlinewiki/outline:latest\n    env_file: ./docker.env\n    expose:\n      - "3000"\n    volumes:\n      - storage-data:/var/lib/outline/data\n    depends_on:\n      - postgres\n      - redis\n\n  redis:\n    image: redis\n    env_file: ./docker.env\n    expose:\n      - "6379"\n    volumes:\n      - ./redis.conf:/redis.conf\n    command: ["redis-server", "/redis.conf"]\n    healthcheck:\n      test: ["CMD", "redis-cli", "ping"]\n      interval: 10s\n      timeout: 30s\n      retries: 3\n\n  postgres:\n    image: postgres\n    env_file: ./docker.env\n    expose:\n      - "5432"\n    volumes:\n      - database-data:/var/lib/postgresql/data\n    healthcheck:\n      test: ["CMD", "pg_isready", "-d", "outline", "-U", "user"]\n      interval: 30s\n      timeout: 20s\n      retries: 3\n    environment:\n      PGDATA: '/var/lib/postgresql/data'\n      POSTGRES_USER: 'user'\n      POSTGRES_PASSWORD: 'pass'\n      POSTGRES_DB: 'outline'\n\n  https-portal:\n    image: steveltn/https-portal\n    env_file: ./docker.env\n    ports:\n      - '80:80'\n      - '443:443'\n    links:\n      - outline\n    restart: always\n    volumes:\n      - https-portal-data:/var/lib/https-portal\n    healthcheck:\n      test: ["CMD", "service", "nginx", "status"]\n      interval: 30s\n      timeout: 20s\n      retries: 3\n    environment:\n      DOMAINS: 'docs.mycompany.com -> http://outline:3000'\n      STAGE: 'production'\n      WEBSOCKET: 'true'\n      CLIENT_MAX_BODY_SIZE: '0'\n\nvolumes:\n  https-portal-data:\n  storage-data:\n  database-data:\n```	2025-10-20 12:49:18.038+00	2025-10-20 12:49:18.038+00	4698e112-c591-46f4-a92b-26e41d5b01e0	536ea67a-0c1a-4692-bf77-e3d0be7e5faa	a526bb13-02e6-4c17-85af-aecd0dcbedcd	f4ec95e8-24e2-4484-b927-a12ae26fa3e2	1	'/)**':90,95 '/docker.env':231,248,277,319 '/outlinewiki/outline:latest':228 '/redis.conf':252,253,258 '/s/hosting':9 '/s/hosting/doc/authentication-7vikrmry5o)**':190 '/var/lib/https-portal':334 '/var/lib/outline/data':238 '/var/lib/postgresql/data':284,302 '0':360 '10s':267 '1gb':164 '20s':297,344 '3':271,299,346 '3000':233,351 '30s':269,295,342 '443':323,324 '512mb':153 '5432':279 '6379':250 '80':